description:
The Amazing Country of Kyrgyzstan

Travel Documentary hosted by Vitaliy Podstrechniy and Yulia Podstrechnaya, published by EPOS in 2008 - English narration


Information
------------------------------

You will discover a mysterious world where monuments of the great civilizations of the past intertwined with the corners of unspoiled nature, you will conquer the highest peaks and fantastic caves, you will dive into the refreshing coolness of emerald lakes and living fairy tale medieval east. The roar of wind and the murmur of flowing mountain streams complement the play of the Kyrgyz music, taking you in the wonderful world - Kyrgyzstan.

